import React from "react";
import { useNavigate } from "react-router-dom";

const HomePage = () => {
  const navigate = useNavigate();

  const handleStart = () => {
    navigate("/dashboard");
  };

  return (
    <div
      style={{
        height: "100vh",
        background: "linear-gradient(to bottom, #87CEFA, #ffffff)",
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "center",
        padding: "2rem",
        textAlign: "center"
      }}
    >
      <h1 style={{ fontSize: "2.5rem", color: "#004e92", marginBottom: "1rem" }}>
        Welcome to In-Flight Insights ✈️
      </h1>
      <p style={{ fontSize: "1.1rem", maxWidth: "600px", marginBottom: "2rem" }}>
        We help airlines reduce food waste and improve sustainability through AI-powered
        data collection and smart meal insights. Let’s dive into your flight's performance
        and impact metrics.
      </p>
      <button
        onClick={handleStart}
        style={{
          padding: "12px 24px",
          fontSize: "1rem",
          backgroundColor: "#007BFF",
          color: "white",
          border: "none",
          borderRadius: "8px",
          cursor: "pointer"
        }}
      >
        Enter Dashboard
      </button>
    </div>
  );
};

export default HomePage;
